PowerISO 4.9.2011 MULTILANGUAGE Nlt-Release


PowerISO Computing heeft versie 4.9 van PowerISO uitgebracht. Met dit programma kunnen floppy-, cd- en dvd-images worden aangemaakt, bewerkt en geconverteerd, onder meer in PowerISO's eigen daa-bestandstype. Daarnaast kan het programma virtuele schijfstations aanmaken. De probeerversie wordt helaas als crippleware uitgebracht, wat in dit geval inhoudt dat niet mogelijk is om images groter dan 300MB aan te maken of aan te passen. Het changelog van deze release laat de volgende veranderingen zien:

Changes in PowerISO version 4.9:
Support Windows 7 taskbar progress bar.
Support ISZ file.
Improve UDF file support.
Some minor bug fixes and enhancements.
